    <div className="Soda">
      <img src={sodaImg} alt="coca cola can" />
      <Message>
        <h1>OMG SUGARRRRR</h1>
        <h1><Link to="/">go back</Link></h1>
      </Message>
      <img src={sodaImg} alt="coca cola can" />
    </div>
  );
}

export default Soda;
